import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { Button, Container, Grid, TextField, Typography } from "@mui/material";
import { Car } from "../types";

const API_URL = "http://localhost:8080/cars";

const CarList = (): JSX.Element => {
  const [cars, setCars] = useState<Car[]>([]);

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const response = await axios.get<Car[]>(API_URL);
      setCars(response.data);
    } catch (error) {
      console.error("Error fetching cars:", error);
    }
  };

  return (
    // <Container>
    <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
      <Grid xs={4} md={8}>
        <Typography variant="h4">Car List</Typography>
        {cars.length
          ? cars.map((car) => (
              <div key={car.id}>
                <Link to={`/cars/${car.id}`}>
                  <Typography>{`${car.make} ${car.model} (${car.year})`}</Typography>
                </Link>
              </div>
            ))
          : null}
      </Grid>
      <Grid spacing={8}>
        <TextField id="outlined-basic" label="Make" variant="outlined" />
        <TextField id="outlined-basic" label="Model" variant="outlined" />
        <TextField id="outlined-basic" label="Year" variant="outlined" />
        <Button variant="outlined">Submit</Button>
      </Grid>
      {/* <Grid xs={4}>
    <Item>xs=4</Item>
  </Grid>
  <Grid xs={4}>
    <Item>xs=4</Item>
  </Grid>
  <Grid xs={8}>
    <Item>xs=8</Item>
  </Grid> */}
    </Grid>
    // </Container>
  );
};

export default CarList;
